import React from "react";
import Header from "./components/headereader";
import ProgressBar from "./components/progressBar";
import CourseList from "./components/courseList";
import Footer from "./components/footer";
const App = () => {
  const studentName = "John Doe";
  const progress = 75;
  const courses = {
    "Fall 2024": ["Math 101", "History 201", "Biology 150"],
    "Spring 2025": ["CS 101", "Physics 110", "Art 100"],
  };

  return (
    <div style={appStyles}>
      <Header studentName={studentName} />
      <ProgressBar progress={progress} />
      {Object.entries(courses).map(([term, courseList]) => (
        <CourseList key={term} term={term} courses={courseList} />
      ))}
      <Footer />
    </div>
  );
};



const appStyles = {
  fontFamily: "Arial, sans-serif",
  maxWidth: "600px",
  margin: "0 auto",
  padding: "20px",
};


export default App;
